script: |
  super -f text -I q3260.spq | sort > q3260.out

inputs:
  - name: q3260.spq
    data: |
      SELECT DISTINCT - 93 AS col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1

outputs:
  - name: q3260.out
    data: |
      -93
